import "./App.css";
import { useState } from "react";
import {Link, Routes,Route} from "react-router-dom";
import SearchComponent from './SearchComponent';


function App() {
  const [showSearchPage, setShowSearchpage] = useState(false);

  return (
    <div className="app">
          <div className="open-search">
            
            <Routes>
              <Route
                exact
                path="/search"
                element={
                  <SearchComponent  />
                }
              />
             
            </Routes>
          </div>
    </div>
  );
}

export default App;
